description:
Helena (Sofia Gucci), is a beautiful woman caught up by time in a risky business linked to the world of debt recovery, he decided to change his life and to escape, stealing a large sum of money to her boss and former lover Matt. Fled to Santo Domingo Helena tries to remain as anonymous as possible, but a chance meeting with Manuel soon turns into attraction and complicity. The two lovers decided to leave behind a past of scams and dangerous situations, flee from Matt and his bodyguards to enjoy the joy and pleasures of their new relationship.

